import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      mosters: [
        {
          name: "Virendra",
        },
        {
          name: "Vishal",
        },
        {
          name: "Aniketh",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {
          this.state.mosters.map()
          }
      </div>
    );
  }
}

export default App;
